import Axios from 'axios'

export const removeObject = ({genre, object, id}) => async (dispatch) => {


    console.log(genre, object, id)
    const response = await Axios({
        method: 'POST',
        url: `http://localhost:8080/api/${genre}/${object}/remove/${id}`
    })

    dispatch({
        type: "REMOVE_OBJECT",
        payload: response
    })
}
